import React from 'react'

export const IconViewer = () => {
	return (
		<div style={{ display: 'flex', flexWrap: 'wrap', gap: 10 }}>
			{Object.keys(icons).map((i, k) => (
				<div key={k} className='d-center' style={{ width: 120, height: 80 }}>
					<div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 5 }}>
						<Icon icon={i} size={48} fill="var(--color-secondary)" />
						<span>{i}</span>
					</div>

				</div>
			))}
		</div>
	)
}

interface IconProps {
	className?: string
	fill?: string
	size?: number
	marginLeft?: number
	margin?: number
	icon: string
}
export const Icon = ({ className, fill, size, icon, marginLeft, margin }: IconProps) => (
	<div className={className} style={{ color: fill, width: size || 16, height: size || 16, marginLeft: marginLeft || 0, marginRight: margin || 0, lineHeight: 1 }}>
		{icons[icon] as any}
	</div>
)

